import { useState } from "react"

var sign, cnt = 0


function Tictac() {

    const [val, setval] = useState(['q', 'q', 'q', 'q', 'q', 'q', 'q', '', ''])

    function selectSign() {
        if (cnt % 2 == 0) {
            sign = 'X'
        }
        else {
            sign = 'O'
        }
    }

    function updateArr(id) {
        selectSign()
        if (val[id] == '') {
            setval(val.map((value, index) => {
                return index == id ? sign : value
            }))
        }
        cnt++
    }
    return (
        <>
            <h1>this is tictactoe file</h1>

            {val}<br></br>

            <button onClick={() => updateArr(0)}>{val[0]}</button>
            <button onClick={() => updateArr(1)}>{val[1]}</button>
            <button onClick={() => updateArr(2)}>{val[2]}</button><br></br>
            <button onClick={() => updateArr(3)}>{val[3]}</button>
            <button onClick={() => updateArr(4)}>{val[4]}</button>
            <button onClick={() => updateArr(5)}>{val[5]}</button><br></br>
            <button onClick={() => updateArr(6)}>{val[6]}</button>
            <button onClick={() => updateArr(7)}>{val[7]}</button>
            <button onClick={() => updateArr(8)}>{val[8]}</button><br></br>

        </>
    )
}

export default Tictac
